INSERT INTO `faq` (`faqID`, `title`, `information`, `status`, `created_at`) VALUES
(12, 'Our Approach', '<p>At Cheltrad education, we adopt the best available approach to \r\neducation. We do not believe in just sticking students in front of \r\ncomputers. Our teaching philosophy tampers compassion with rigour and \r\ndiscipline.</p>', 1, '2020-07-02'),
(13, 'Duration of Class', '<p>The duration of the tuition depends on the age, ability and need of the student.</p>', 1, '2020-07-02'),
(14, 'KEY STAGE 1 (Year 1 and 2)', '<p>The two main subjects at Key Stage 1 are Mathematics and English.</p>\r\n<p>The English course consists of: Developing skills on Phonetics, \r\nPhonemic Awareness, Spelling, Vocabulary, Sentence Structure, Developing\r\n Short Paragraphs and Comprehension.</p>\r\n<p>The Mathematics course consists of:&nbsp; Developing Skills on Counting, Addition, Subtraction, Multiplication and Division.</p>', 1, '2020-07-02'),
(15, 'Course Content', '<p>Lessons are structured according to National Curriculum to compliment \r\nschool work. This is aimed at supporting children to comprehend work at \r\nschool and to be ahead of peers.</p>', 1, '2020-07-03'),
(16, 'Assessment', '<p>We have a culture of continuous assessment to always identify dynamics \r\nin pupils’ focus areas and lessons are adjusted accordingly.</p>', 1, '2020-07-03'),
(17, 'Year 2 SAT', '<p>Pupils are prepared for SAT and lessons are tailored to enable pupils achieve the highest possible grades.</p>', 1, '2020-07-03'),
(18, 'KEY STAGE 2 (Years 3, 4, 5 and 6)', '<p>The two main subjects at Key Stage 2 are Mathematics and English.</p>\r\n<p>The English course consists of: Developing skills on Grammar, \r\nPunctuation, Spelling, Vocabulary, Comprehension, Composition and \r\nCreative Writing.</p>\r\n<p>The Mathematics course consists of:&nbsp; Developing skills on Addition, \r\nSubtraction, Multiplication, Division, Geometry, Algebra and Statistics.</p>', 1, '2020-07-03'),
(19, 'Class Capacity', '<p>Number of pupils in every session ranges from 1 to 5 children at any \r\ntime. Work is differentiated and pupils are supported to work according \r\nto their individual pace.</p>', 1, '2020-07-03'),
(20, 'Course Content', '<p>Lessons are structured based on the National Curriculum to complement school work. This is aimed at supporting children to comprehend work at school and to be ahead of their peers.</p>', 1, '2020-07-03'),
(21, 'Assessment', '<p>We have a culture of continuous assessment to always identify dynamics \r\nin pupils’ focus areas and lessons are adjusted to address areas of \r\nneeds. Parents are updated accordingly.</p>', 1, '2020-07-03'),
(22, 'Year 6 SAT', '<p>SAT style papers are revised in Year 6 and lessons are tailored to enable pupils achieve the highest possible grades.</p>', 1, '2020-07-03');

