INSERT INTO `page_content` (`downloadID`, `title`, `content`, `file_name`, `file_ext`, `active`, `create_at`, `updated_at`, `file_type`) VALUES
(1, 'About Cheltrad Education', '<div class=\"about-page-content pt-40\">\r\n                            <div class=\"section-title pb-15\">\r\n                                <h2>About <span>Cheltrad Education </span></h2>\r\n                            </div> \r\n                            <p class=\"text-justify\">\r\n\r\n                                Cheltrad Education was founded in 2012 \r\nas a small private tuition centre. With over ten years experience in \r\nmainstream education and social work setting, we are dedicated to \r\npioneering a new approach. Combining small size classes; quality first \r\nteaching and attention for each student; we believe in nurturing \r\npotential.\r\n\r\n                                Teachers are at the core of our success.\r\n We consult with teachers who have held positions such as Head of \r\nDepartment, Lead Practitioners and Examiners. Their valuable insights \r\nand expertise has been the key to our success.\r\n\r\n                                The teachers’ enthusiasm set the \r\nprecedent for our students. Whether they are teaching a class or \r\nproviding one-to-one tutorial, our teachers go above and beyond \r\nexpectations to better and challenge individual pupil.\r\n\r\n                                The first step to see us in action is to\r\n book an assessment or fill out the Form on our website. Assessments are\r\n free for all new students. After weighing initial expectations from \r\nparents or guardians, assessment results are used to set an individual \r\nprogramme for each pupil.\r\n\r\n                            </p>\r\n                        </div>', '816441593277224.jpg', 'jpg', 1, '2020-06-27', NULL, 1),
(2, 'Cheltrad Education', '<p>“Education is the most powerful weapon which you can use to change the world”</p>\r\n                            \r\n                                <div class=\"donate-form mt-10 mr-25\">\r\n                                        <p>\r\n                                            Cheltrad Education is for \r\nthe ambitious student whose aspirations are broad and whose\r\n                                            academic dreams are big. It \r\nis for the hardworking and diligent students who want to excel\r\n                                            and broaden their academic \r\nhorizons...\r\n                                        </p>\r\n                                </div>', NULL, NULL, 1, NULL, '2020-07-06', 7),
(3, 'Online Tutoring', '<p class=\"text-justify\">\r\n                                We have a team of highly qualified \r\ntutors having degrees in Maths, English &amp; Science from the world\'s top \r\nUniversities.\r\n                                Our tutors are well experienced to teach\r\n 7 Plus, 11 Plus, 13 Plus, Independent schools GCSE and A-Levels Exams.\r\n                            </p>\r\n                            <p class=\"text-justify\">\r\n                                Contact us for customized &amp; tailored\r\n tutoring. Every class is provided with Lecture notes, homework, and \r\npast paper materials.\r\n                            </p>', NULL, NULL, 1, NULL, '2020-07-06', 2),
(4, 'Practice Material', '<p class=\"text-justify\">\r\n                                Each material is designed and crafted by\r\n 11 Plus (11+) Experts which is customised to meet the requirements\r\n                                of all 11+ exam styles including CEM, GL\r\n Assessment, CSSE (Essex), SET (Sutton) and Independent Schools\r\n                                Past Papers.\r\n                            </p>\r\n                            <p class=\"text-justify\">\r\n                                Practice from large library of expert \r\nlevel Papers and download various formula sheets, checklists,\r\n                                planners and other support resources.\r\n                            </p>', NULL, NULL, 1, NULL, '2020-07-06', 3),
(5, 'Free Online Timed Mocks', '<p class=\"text-justify\">\r\n                                We are offering free online mocks for \r\neveryone who want to practice and achieve success\r\n                                in 11+ Grammar &amp; Independent school \r\nexams. Practice for free and improve your child’s score and confidence\r\n                                levels.\r\n                            </p>\r\n                            <p class=\"text-justify\">\r\n                                Try topic mocks and after completion, \r\nyou can see the detailed analysis of topics as well as where you\r\n                                stand on the leaderboard.\r\n                            </p>', NULL, NULL, 1, NULL, '2020-07-06', 4),
(6, 'Quality Tutoring', '<p>\r\n                            All our tutors are highly qualified, \r\nexperienced, and trained specifically to teach required courses. All \r\nlessons are highly interactive, covering thorough an understanding of \r\nthe concept with plenty of examples to practise.\r\n                        </p>\r\n                        <p>\r\n                            Our highly structured 11 plus tutoring \r\napproach provides exceptional support for students and initiate their \r\nlogical thinking. Our high success rate is based on our highly qualified\r\n and experienced tutors who deliver quality lessons and every tutor is \r\npassionate for students success. Each student is assessed to determine \r\ntheir strengths and weaknesses. This process allows us to customise the \r\ntutoring sessions to fit each student’s educational needs.\r\n                             We provide a weekly schedule, topics wise \r\nand revisions test with instant marking system along with solutions so \r\nthat parents can do go through of wrong answers.\r\n                        </p>', '870211594035743.jpg', 'jpg', 1, '2020-07-06', NULL, 5),
(7, 'Joshef L Kilari, UK', '<p>Extremely easy login to our online sessions, just in few clicks.&lt;/p&gt;&lt;p&gt;The sessions are one to one with video and audio and all sessions are tailored as per your child\'s need.<br></p>', '746451594036011.jpg', 'jpg', 1, '2020-07-06', NULL, 6),
(8, 'Bobby Akter, USA', '<p>Extremely easy login to our online sessions, just in few clicks.</p><p>The sessions are one to one with video and audio and all sessions are tailored as per your child\'s need.<br></p>', '383681594036054.png', 'png', 1, '2020-07-06', NULL, 6);

