INSERT INTO `product_question` (`questionID`, `quizID`, `categoryID`, `courseID`, `classID`, `question`, `question_file_name`, `correct_option`, `correct_answer`, `correct_answer_file_name`, `question_solution`, `a`, `b`, `c`, `d`, `e`, `option_show`, `created_at`, `updated_at`, `created_by`, `question_status`, `question_token`, `soft_delete`) VALUES
(1, 5, 8, 8, NULL, '<p><b> The value of x + x(x<sup>x</sup>) when x = 2 is:</b></p>', NULL, 'A', NULL, NULL, NULL, '10', '16', '18', '36', NULL, 4, '2020-07-07', '2020-07-07', 1, 1, 'YOU6Z2DHY79AQYB', 0),
(2, 3, 7, 28, 4, '<p><b>Mr. Jones sold two pipes at $1.20 each. Based on the cost, his profit one was 20% and its loss on the other was 20%. On the sale of the\r\n pipes, he:</b></p>', NULL, 'D', NULL, NULL, NULL, 'broke even', 'lost 4 cents', 'gained 4 cents', 'lost 10 cents', 'gained 10 cents', 5, '2020-07-07', '2020-07-07', 1, 1, '0WF5OTAXO87JMYE', 0),
(3, 5, 8, 8, NULL, '<p><b>4. The distance light travels in one year is approximately 5,870,000,000,000 miles. The distance light travels in 100 years is:</b></p>', NULL, 'D', NULL, NULL, NULL, '587 × 10^8 miles', '587 × 10^10 miles,', '587 × 10^-10 miles', '587 × 10^12 miles', '587 × 10^-12 miles', 5, '2020-07-07', '2020-07-07', 1, 1, '9Q5JHD9LU8E25XW', 0),
(4, 5, 8, 8, NULL, '<p><b>A man has $ 10,000 to invest. He invests $ 4000 at 5 % and $ 3500 \r\nat 4 %. In order to have a yearly income of $ 500, he must invest the \r\nremainder at:</b></p>', NULL, 'E', NULL, NULL, '<p><b><span style=\"color: rgb(0, 0, 0);\">Solution:</span></b><br><br>\r\nIncome from $ 4000 at 5 % in one year = $ 4000 of 5 %.<br><br>\r\n= $ 4000 × 5/100.<br><br>\r\n= $ 4000  × 0.05.<br><br>\r\n= $ 200.<br><br>\r\nIncome from $ 3500 at 4 % in one year = $ 3500 of 4 %.<br><br>\r\n= $ 3500 × 4/100.<br><br>\r\n= $ 3500  × 0.04.<br><br>\r\n= $ 140.<br><br>\r\nTotal income from 4000 at 5 % and 3500 at 4 % = $ 200 + $ 140 = $ 340.<br><br>\r\nRemaining income amount in order to have a yearly income of $ 500\r\n= $ 500 - $ 340.<br><br> \r\n= $ 160.<br><br> \r\nTotal invested amount = $ 4000 + $ 3500 = $7500.<br><br>\r\nRemaining invest amount = $ 10000 - $ 7500 = $ 2500.<br><br>\r\nWe know that, <b>Interest = Principal × Rate  ×  Time</b><br><br>\r\nInterest = $ 160,<br><br>\r\nPrincipal = $ 2500, <br><br>\r\nRate = r [we need to find the value of r],<br><br>\r\nTime = 1 year.<br><br>\r\n160 = 2500 × r × 1.<br><br>\r\n160 = 2500r<br><br>\r\n160/2500 = 2500r/2500 [divide both sides by 2500]<br><br>\r\n0.064 = r<br><br>\r\nr = 0.064<br><br>\r\nChange it to a percent by moving the decimal to the right two places\r\nr = 6.4 %<br><br>\r\nTherefore, he invested the remaining amount $ 2500 at 6.4 % in order to get $ 500 income every year.</p>', '6 %', '6.1 %', '6.2 %', '6.3 %', '6.4 %', 5, '2020-07-07', '2020-07-07', 1, 1, 'N57PGQNVON1FNHV', 0),
(5, 5, 8, 8, NULL, '<p><b>Jones covered a distance of 50 miles on his first trip. On a later\r\n trip he traveled 300 miles while going three times as fast. His new \r\ntime compared with the old-time was:</b></p>', NULL, 'B', NULL, NULL, '<p>Let speed of the 1st trip x miles / hr. and speed of the 2nd trip 3x / hr.<br><br>\r\nWe know that<br><br>\r\n<b> Speed = Distance/Time.</b><br><br>\r\nOr, <i>Time = Distance/Speed.</i><br><br>\r\nSo, times taken to covered a distance of 50 miles on his first trip = 50/x hr.<br><br>\r\nAnd times taken to covered a distance of 300 miles on his later trip = 300/3x hr.<br><br> \r\n= 100/x hr.<br><br>\r\nSo we can clearly see that his new time compared with the old time was: twice as much.<br><br>  \r\n<b>Answer: (b)</b></p>', '<p><b>three times as much</b></p>', '<p><b> twice as much</b></p>', '<p><b>the same</b></p>', '<p><b>half as much</b></p>', NULL, 4, '2020-07-08', '2020-07-08', 1, 1, 'YV7FZ58S7FKVAM6', 0),
(6, 5, 8, 8, NULL, '<p><b>If 10<sup>2y</sup> = 25, then 10<sup>-y</sup> equals:</b></p>', NULL, 'E', NULL, NULL, '<p>10<sup>2y</sup> = 25<br><br>\r\n(10<sup>y</sup>)<sup>2</sup> = 5<sup>2</sup><br><br>\r\n10<sup>y</sup> = 5<br><br>\r\n<sup>1</sup>/<sub>10<sup>y</sup></sub> = <sup>1</sup>/<sub>5</sub> <br><br>\r\n10<sup>-y</sup> = <sup>1</sup>/<sub>5</sub><br><br>\r\n<b>Answer: (e)</b></p>', '<p><b><sup>-1</sup>/<sub>5</sub></b></p>', '<p><b><sup>1</sup>/<sub>625</sub></b></p>', '<p><b><sup>1</sup>/<sub>50</sub></b></p>', '<p><b><sup>1</sup>/<sub>25</sub></b></p>', '<p><b><sup>1</sup>/<sub>5</sub></b></p>', 5, '2020-07-08', '2020-07-08', 1, 1, 'ICA5PL1WDVI5Q71', 0);
INSERT INTO `product_question` (`questionID`, `quizID`, `categoryID`, `courseID`, `classID`, `question`, `question_file_name`, `correct_option`, `correct_answer`, `correct_answer_file_name`, `question_solution`, `a`, `b`, `c`, `d`, `e`, `option_show`, `created_at`, `updated_at`, `created_by`, `question_status`, `question_token`, `soft_delete`) VALUES
(7, 5, 8, 8, NULL, '<p><b>The fraction <sup>(5x-11)</sup>/<sub>(2x<sup>2</sup> + x - 6)</sub> was obtained by adding the two fractions <sup>A</sup>/<sub>(x + 2)</sub> and <sup>B</sup>/<sub>(2x - 3)</sub>. The values of A and B must be, respectively:</b></p>', NULL, 'C', NULL, NULL, '<p><img src=\"https://www.math-only-math.com/images/xpartial-fraction.jpg.pagespeed.ic.bc-ExN8S47.jpg\" alt=\"Partial Fraction\" title=\"Partial Fraction\" data-pin-media=\"https://www.math-only-math.com/images/partial-fraction.jpg\" width=\"622\"><img style=\"width: 439.833px;\" src=\"data:image/png;base64,\" data-filename=\"image.png\"></p>', '<p><b>5x, -11</b></p>', '<b>-11, 5x</b>', '<p><b>-1, 3</b></p>', '<p><b>3, -1</b></p>', '<p><b>5, -11</b></p>', 5, '2020-07-08', '2020-07-08', 1, 1, 'F4DESCOXUVE65TT', 0);
