(9, 2, 5, 16, 3, '<p><b>What number is greater than 4  and lesser than 6?</b><br></p>', NULL, NULL, '<p>5 is greater than 4 and also lesser than 6.<br></p>', NULL, NULL, '<p><b>three times as much</b></p>', '<p><b>three times as much</b></p>', '<p><b>three times as much</b></p>', '<p><b>three times as much</b></p>', '<p><b>three times as much</b></p>', 0, '2020-07-08', '2020-07-08', 1, 1, 'E5OWZRVKW8VIAC3', 0),
(10, 2, 5, 16, 3, '<p><b>Combine terms: 12a + 26b -4b – 16a.</b></p>', NULL, NULL, '<p><b>-4a + 22b    </b></p>', NULL, '<p><br>\r\n12a + 26b -4b – 16a.<br><br>\r\n= 12a – 16a + 26b – 4b.<br><br>\r\n= -4a + 22b.</p>', NULL, NULL, NULL, NULL, NULL, 0, '2020-07-08', '2020-07-08', 1, 1, 'CRUZQTHA5IR1TPS', 0),
(11, 2, 5, 16, 3, '<p><b>Simplify: (4 – 5) – (13 – 18 + 2)</b></p>', NULL, NULL, '<p><b>2</b></p>', NULL, '<p><br>\r\n(4 – 5) – (13 – 18 + 2).<br><br>\r\n= -1-(13+2-18).<br><br>\r\n= -1-(15-18).<br><br>\r\n= -1-(-3).<br><br>\r\n= -1+3.<br><br>\r\n= 2.</p>', NULL, NULL, NULL, NULL, NULL, 0, '2020-07-08', '2020-07-08', 1, 1, 'JXAULEY2JFS8I0M', 0),
(12, 1, 10, 42, 3, '<p><span style=\"left: 180.033px; top: 106.609px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.907776);\">The fifteenth</span><span style=\"left: 210.233px; top: 106.609px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.910053);\"> and sixteenth-century voyages</span><span style=\"left: 415.883px; top: 106.609px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.908881);\"> of exploration produced lasting changes in the political and social </span><span style=\"left: 180.033px; top: 126.409px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.901106);\">structure of Western Europe.  </span></p><p><span style=\"left: 180.033px; top: 126.409px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.901106);\">Would you say that these voyages tended to hasten or to delay the growth of national </span><span style=\"left: 180.033px; top: 146.243px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.890219);\">states?  Explai</span><span style=\"left: 276.233px; top: 146.243px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.884477);\">n.</span></p>', NULL, NULL, '<p><span style=\"left: 540.083px; top: 401.843px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.90879);\">The exploration of the 15th and 16th centuries </span><span style=\"left: 852.567px; top: 401.843px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.84705);\">hastened the</span><span style=\"left: 914.767px; top: 401.843px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.877942);\"> </span><span style=\"left: 540.083px; top: 421.693px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.900242);\">growth of national states.  The reasons have to do with </span><span style=\"left: 906.967px; top: 421.693px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.938721);\">war, </span><span style=\"left: 540.083px; top: 441.493px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.902461);\">wealth, trade, and nationalism.  </span><span style=\"left: 540.083px; top: 481.093px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.912831);\">One of the prime ingredients for the beginning o</span><span style=\"left: 861.567px; top: 481.093px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.931906);\">f national </span><span style=\"left: 540.083px; top: 500.893px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.885775);\">states was a common danger from outside.  Because countries </span><span style=\"left: 540.083px; top: 520.693px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.91237);\">went to war over the right to control certain colonies and trade </span><span style=\"left: 540.083px; top: 540.493px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.923668);\">routes, each country had to unite within in order to fight off </span><span style=\"left: 540.083px; top: 560.293px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.876663);\">any aggressor.</span><span style=\"left: 540.083px; top: 599.893px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.914041);\"> Other forms of competition between count</span><span style=\"left: 822.167px; top: 599.893px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.916646);\">ries contributed to </span><span style=\"left: 540.083px; top: 619.693px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.912395);\">the growth of national states.  Competition for land and wealth </span><span style=\"left: 540.083px; top: 639.493px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.892611);\">was fierce.  The resources of the new lands, </span><span style=\"left: 834.567px; top: 639.493px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.879943);\">such as coffee, </span><span style=\"left: 540.083px; top: 659.293px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.888882);\">spices, minerals</span><span style=\"left: 645.917px; top: 659.293px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.896496);\">, were considered valuable.  Each country was </span><span style=\"left: 540.083px; top: 679.093px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.887967);\">eager to gain land because the products of the la</span><span style=\"left: 860.167px; top: 679.093px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.904437);\">nd could be </span><span style=\"left: 540.083px; top: 699.293px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.912614);\">turned into more wealth, </span><span style=\"left: 707.117px; top: 699.293px; font-size: 16.6px; font-family: sans-serif;\">[</span><span style=\"left: 712.717px; top: 699.293px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.88399);\">as when Cortez conquered the </span><span style=\"left: 540.083px; top: 719.526px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.919489);\">Aztecs and exploited their gold and silver.</span><span style=\"left: 821.367px; top: 719.526px; font-size: 16.6px; font-family: sans-serif;\">]</span><span style=\"left: 835.367px; top: 719.526px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.931519);\">A united country </span><span style=\"left: 540.083px; top: 739.326px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.913963);\">could best succeed in this form of competition.</span><span style=\"left: 540.083px; top: 778.926px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.888222);\"> These resources, brought about by new discoveries, increased </span><span style=\"left: 540.083px; top: 798.726px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.909936);\">the power of mer</span><span style=\"left: 653.717px; top: 798.726px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.921904);\">cantilism.  Mercantilism is a system in which </span><span style=\"left: 540.083px; top: 818.526px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.905468);\">the mother country takes from its colonies raw materials and </span><span style=\"left: 540.083px; top: 838.326px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.917503);\">sells them back in the form of finished products.  This allows </span><span style=\"left: 540.083px; top: 858.126px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.908458);\">the mother country to keep economic control over the </span><span style=\"left: 540.083px; top: 877.926px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.916411);\">colonies.  With the opening of ne</span><span style=\"left: 761.167px; top: 877.926px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.902463);\">w trade routes, the Northern </span><span style=\"left: 540.083px; top: 897.726px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.890308);\">and Western European states were able to break the Venetian</span><span style=\"left: 947.767px; top: 897.726px; font-size: 16.6px; font-family: sans-serif;\">-</span><span style=\"left: 540.083px; top: 917.526px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.923132);\">Arab trade monopoly with the Indies.  The colonization led to </span><span style=\"left: 540.083px; top: 937.326px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.896976);\">a system involving a state</span><span style=\"left: 710.717px; top: 937.326px; font-size: 16.6px; font-family: sans-serif;\">-</span><span style=\"left: 716.117px; top: 937.326px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.903587);\">controlled market between the </span><span style=\"left: 540.083px; top: 957.126px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.918069);\">colony and the mother country.  This permitted t</span><span style=\"left: 862.167px; top: 957.126px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.899597);\">he nations of </span><span style=\"left: 540.083px; top: 976.926px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.902273);\">Europe to become economically separate units with no </span><span style=\"left: 540.083px; top: 996.776px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.901348);\">common market existing between them</span><span style=\"left: 800.367px; top: 996.774px; font-size: 16.6px; font-family: sans-serif;\">—</span><span style=\"left: 816.967px; top: 996.776px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.929583);\">a condition that </span><span style=\"left: 540.083px; top: 1016.58px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.911215);\">fostered nationalism.  It is interesting to note that </span><span style=\"left: 870.167px; top: 1016.58px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(1.00091);\">Italy</span><span style=\"left: 900.367px; top: 1016.58px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.933179);\">, which </span><span style=\"left: 540.083px; top: 1036.38px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.922302);\">did a little exploration, took longer to become a united nation </span><span style=\"left: 540.083px; top: 1056.18px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.885613);\">than d</span><span style=\"left: 581.117px; top: 1056.18px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.910085);\">id the other countries of Europe.</span><span style=\"left: 540.083px; top: 1095.78px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.911018);\"> Another feature in</span><span style=\"left: 648.717px; top: 1095.78px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.901064);\"> producing national states was the national </span><span style=\"left: 540.083px; top: 1115.98px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.886725);\">pride these voyages tended to produce.  </span><span style=\"left: 807.367px; top: 1115.98px; font-size: 16.6px; font-family: sans-serif;\">[</span><span style=\"left: 812.967px; top: 1115.98px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.887358);\">The voyages were </span><span style=\"left: 540.083px; top: 1135.78px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.908006);\">financed by a national government.  Any new discovery was </span><span style=\"left: 540.083px; top: 1155.57px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.88912);\">seen as reflecting the prestige of the spon</span><span style=\"left: 814.367px; top: 1155.57px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.903968);\">soring government </span><span style=\"left: 540.083px; top: 1175.37px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.909955);\">and its people, </span><br><span style=\"left: 540.083px; top: 1175.37px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.909955);\"><span style=\"left: 540.083px; top: 1175.37px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.909955);\"> and this added pride contributed to the spirit of </span><span style=\"left: 540.083px; top: 1195.57px; font-size: 16.6px; font-family: sans-serif; transform: scaleX(0.915983);\">nationalism.</span><span style=\"left: 621.317px; top: 1195.57px; font-size: 16.6px; font-family: sans-serif;\">]</span></span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2020-07-08', '2020-07-08', 1, 1, 'ZEO5XJ6RRMLKVV0', 0),
(13, 1, 10, 42, 3, '<p><span style=\"left: 168px; top: 328.578px; font-size: 20px; font-family: serif; transform: scaleX(1.06941);\">List the 7-step path to making “ethical</span><span style=\"left: 495.9px; top: 328.578px; font-size: 20px; font-family: serif; transform: scaleX(1.06657);\"> decisions.” </span></p><p><span style=\"left: 495.9px; top: 328.578px; font-size: 20px; font-family: serif; transform: scaleX(1.06657);\">List them in their correct </span><span style=\"left: 168px; top: 351.578px; font-size: 20px; font-family: serif; transform: scaleX(1.08297);\">progressive order. </span></p>', NULL, NULL, '<p><span style=\"left: 203px; top: 536.178px; font-size: 20px; font-family: serif; transform: scaleX(1);\">1.</span><span style=\"left: 233px; top: 536.178px; font-size: 20px; font-family: serif; transform: scaleX(1.0007);\"> The question does not require students to us</span><span style=\"left: 584.8px; top: 536.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999712);\">e complete sentences or more than one </span><span style=\"left: 233px; top: 559.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999885);\">sentence. Students may respond to Example A by simply listing the name and </span><span style=\"left: 233px; top: 582.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00009);\">number for each step. </span></p><p><span style=\"left: 233px; top: 582.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00009);\"><br></span><span style=\"left: 203px; top: 628.178px; font-size: 20px; font-family: serif; transform: scaleX(1);\">2.</span><span style=\"left: 233px; top: 628.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00037);\"> Depending on where students learned the step</span><span style=\"left: 600.8px; top: 628.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999897);\">s, all the responses they give to the </span><span style=\"left: 233px; top: 651.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00052);\">essay question may be identical. Students </span><span style=\"left: 570.3px; top: 651.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999945);\">will basically repeat the 7-step path </span><span style=\"left: 233px; top: 674.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00057);\">word for word. The question does not allo</span><span style=\"left: 569.7px; top: 674.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999608);\">w for original responses or response </span><span style=\"left: 233px; top: 697.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00196);\">patterns. </span></p><p><span style=\"left: 233px; top: 697.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00196);\"><br></span><span style=\"left: 203px; top: 743.178px; font-size: 20px; font-family: serif; transform: scaleX(1);\">3.</span><span style=\"left: 233px; top: 743.178px; font-size: 20px; font-family: serif; transform: scaleX(1.0003);\"> Although the question does require a list of</span><span style=\"left: 579.1px; top: 743.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999805);\"> steps, it does not require systematic </span><span style=\"left: 233px; top: 766.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999829);\">and complex thinking about the ideas. While</span><span style=\"left: 591.1px; top: 766.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00012);\"> some essay questions may serve their </span><span style=\"left: 233px; top: 789.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00059);\">purpose in requiring students to list certain ideas, the most effective essay </span><span style=\"left: 233px; top: 812.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999369);\">questions require deep and </span><span style=\"left: 451.8px; top: 812.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00274);\">original thinking. Effectiv</span><span style=\"left: 660.1px; top: 812.178px; font-size: 20px; font-family: serif; transform: scaleX(0.999967);\">e essay questions elicit a </span><span style=\"left: 233px; top: 835.178px; font-size: 20px; font-family: serif; transform: scaleX(1.0005);\">depth of thought from students that </span><span style=\"left: 519.7px; top: 835.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00072);\">can only be judged by someone with the </span><span style=\"left: 233px; top: 858.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00029);\">appropriate experience and expertise in th</span><span style=\"left: 568px; top: 858.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00379);\">e content matter. Thus, content expertise </span><span style=\"left: 233px; top: 881.178px; font-size: 20px; font-family: serif; transform: scaleX(1.00048);\">is essential for both writing and grading essay questions.  </span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '2020-07-08', '2020-07-08', 1, 1, 'YFODUP3GZDYC8RW', 0);

